import React from 'react';
import AutoAwesomeMosaicIcon from '@mui/icons-material/AutoAwesomeMosaic';
import { Avatar, Box, Typography } from '@mui/material';
import {
  partnersBoxStyles,
  partnersContainerStyles,
  partnersHeaderStyles,
  partnersInnerContainerStyles,
} from './partnersStyles';
import InstKomLogo from '../../images/institut_kom.png';

const Partners = () => {
  return (
    <Box sx={partnersContainerStyles}>
      <Typography sx={partnersHeaderStyles} variant={'h2'}>
        Нас выбирали
      </Typography>
      <Box sx={partnersInnerContainerStyles}>
        <Box sx={partnersBoxStyles}>
          <Avatar
            src={InstKomLogo}
            sx={{ width: '60px', height: '60px', margin: '0 5px 0 0' }}
          />
          <Typography variant={'subtitle1'}>
            Институт Телекоммуникаций
          </Typography>
        </Box>
        <Box sx={partnersBoxStyles}>
          <AutoAwesomeMosaicIcon />
          <Typography variant={'subtitle1'}>Partner</Typography>
        </Box>
        <Box sx={partnersBoxStyles}>
          <AutoAwesomeMosaicIcon />
          <Typography variant={'subtitle1'}>Partner</Typography>
        </Box>
        <Box sx={partnersBoxStyles}>
          <AutoAwesomeMosaicIcon />
          <Typography variant={'subtitle1'}>Partner</Typography>
        </Box>
        <Box sx={partnersBoxStyles}>
          <AutoAwesomeMosaicIcon />
          <Typography variant={'subtitle1'}>Partner</Typography>
        </Box>
        <Box sx={partnersBoxStyles}>
          <AutoAwesomeMosaicIcon />
          <Typography variant={'subtitle1'}>Partner</Typography>
        </Box>
      </Box>
    </Box>
  );
};

export default Partners;
